abel. This is recommended and can be hidden in the Advanced Settings.'=>'Saisir le texte du libellé du champ de formulaire. Ceci est recommandé mais peut être masqué dans les réglages avancés.','Check this option to mark the field required. A form will not submit unless all required fields are provided.'=>'Cocher pour marquer le champ comme requis. Un formulaire ne sera pas soumis à moins que tous les champs obligatoires soient fournis.','Success message that shows up after submitting form. <a href="%1$s" target="_blank">Learn More</a>'=>'Message de réussite qui s’affiche après l’envoi du formulaire. <a href="%1$s" target="_blank">En savoir plus</a>','Automatically scroll to the submission message'=>'Faites défiler automatiquement jusqu’au message d’envoi','Choose where to redirect after form submission. <a href="%s" target="_blank">Learn More</a>'=>'Choisir où rediriger après l’envoi du formulaire. <a href="%s" target="_blank">En savoir plus</a>','Choose design template for the Form'=>'Choisir le modèle pour le formulaire','Submit Button'=>'Bouton d’envoi','Submit button processing text'=>'Texte du bouton lors de l’envoi','Please enable Stripe'=>'Veuillez activer Stripe','Enable Stripe Payment gateway in payments section to use this field.'=>'Activer la passerelle de paiement Stripe dans la section des paiements pour utiliser ce champ.','Minimum value is greater than Maximum value.'=>'La valeur minimale est supérieure à la valeur maximale.','Maximum value is smaller than Minimum value.'=>'La valeur maximale est inférieure à la valeur minimale.','Determine which format of email to send. HTML Template is default.'=>'Déterminer le format de l’e-mail à envoyer. Le modèle par défaut est en HTML.','Enable copies'=>'Activer les copies','Email addresses for Cc and Bcc can be applied from the form notification settings.'=>'Les adresses e-mail pour Cc et Cci peuvent être appliquées à partir des réglages de notification de formulaire.','Please enter your secret key for your r