="_blank">En savoir plus</a>','Submit button class'=>'Classe CSS du bouton d’envoi','Everest Forms has been updated! To keep things running smoothly, we have to update your database to the newest version. The database update process runs in the background and may take a little while, so please be patient.'=>'Everest Forms a été mis à jour ! Pour que tout fonctionne bien, nous devons mettre à jour votre base de données vers la dernière version. Le processus de mise à jour de la base de données s’exécute en arrière-plan et peut prendre un peu de temps, soyez patient.','Choose the type of CAPTCHA for this site key.'=>'Choisir le type de CAPTCHA pour cette clé de site.','Signature'=>'Signature','Survey Fields'=>'Champs d’enquête','Rating'=>'Notation','Scale Rating'=>'Échelle d’évaluation','%1$s: Entry #%2$s'=>'%1$s : entrée N° %2$s','Likert'=>'Likert','New Form Entry %s'=>'Entrée de formulaire nouvelle %s','Available Fields'=>'Champs disponibles','Others'=>'Autres','Site Name'=>'Nom du site','Site URL'=>'URL du site','Page Title'=>'Titre de la page','Page ID'=>'ID de la page','User ID'=>'ID de l’utilisateur','User Name'=>'Nom d’utilisateur','User Email'=>'Adresse e-mail de l’utilisateur','Referrer URL'=>'URL de référence','Site Admin Email'=>'E-mail de l’administrateur','Page URL'=>'URL de la page','Drag and Drop contact form builder to easily create simple to complex forms for any purpose. Lightweight, Beautiful design, responsive and more.'=>'Créateur de formulaires de contact par glisser-déposer pour créer facilement des formulaires simples ou complexes pour n’importe quel but. Léger, moderne, responsive et plus encore.','Admin Notification'=>'Notification à l’admin','Add New Email'=>'Nouveau e-mail','Email Notifications'=>'Notifications e-mail','User Notification'=>'Notification utilisateur','You must provide a Email nickname'=>'Vous devez fournir un surnom d’e-mail','Enter a Email nickname'=>'Saisir un surnom d’e-mail','Eg: Support Email'=>'Ex. : e-mail de support','Deactivate %s now'=>'Désactiver %s maintenant','Activate %s now'=>'Activer %s maintenant','Install %s now'=>'Installer %s maintenant','Reply To'=>'Répondre à','While you visit our site, we’ll track:'=>'Pendant votre visite du site, nous suivons  :','Form Fields Data: Forms Fields data includes the available field types when creating a form. We’ll use this to, for example, collect informations like Name, Email and other available fields.'=>'Données de champs de formulaire  : les données de champs de formulaires incluent les types de champs disponibles lors de la création d’un formulaire. Nous allons utiliser cela pour, par exemple, collecter des informations telles que Nom, E-mail et autres champs disponibles.','Location, IP address and browser type: we’ll use this for purposes like geolocating users and reducing fraudulent activities.'=>'Position, adresse IP et type de navigateur  : nous l’utilisons à des fins telles que la géolocalisation des utilisateurs et la réduction des activités frauduleuses.','Transaction Details: we’ll ask you to enter this so we can, for instance, provide subscription packs, and keep track of your payment details for subscription packs!'=>'Détails de la transaction  : nous vous demanderons de saisir cette information afin de pouvoir, par exemple, vous fournir des offres d’abonnement et garder une trace de vos détails de paiement pour les offres d’abonnement !','We’ll also use cookies to keep track of form elements while you’re browsing our site.'=>'Nous utiliserons également des cookies pour suivre les éléments de formulaire lorsque vous naviguez sur notre site.','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Note  : vous pouvez détailler votre politique de cookies, et faire un lien vers cette section à partir d’ici.','Send you information about your account and order'=>'Envoie de l’information à propos de votre compte et commande','Respond to your requests, including transaction details and complaints'=>'Répondre à vos demandes, y compris les détails de la transaction et les plaintes.','Process payments and prevent fraud'=>'Traitement des paiements et prévention de la fraude','Set up your account for our site'=>'Configurez votre compte pour notre site','Comply with any legal obligations we have, such as calculating taxes'=>'Se conformer avec toute obligation légale, telle que le calcul des taxes','Improve our form offerings'=>'Améliorer nos offres de formulaires','Send you marketing messages, if you choose to receive them'=>'Vous envoyer des messages marketing, si vous choisissez d’en recevoir','Or any other service the built form was created to comply with and it’s necessary information'=>'Ou tout autre service pour lequel le formulaire a été créé pour compléter les informations nécessaires.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the form fields for future submissions.'=>'Si vous créez un compte, nous enregistrerons votre nom, votre adresse, votre adresse e-mail et votre numéro de téléphone, qui seront utilisés pour renseigner les champs du formulaire lors de futures soumissions.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store form submission information for XXX years for geolocating and marketting purposes. This includes your name, address, email, phone number.'=>'Nous stockons généralement des informations vous concernant aussi longtemps que nous en avons besoin aux fins pour lesquelles nous les recueillons et les utilisons, et nous ne sommes pas tenus légalement de continuer à les conserver. Par exemple, nous allons stocker les informations de soumission de formulaire pour les XXX années à des fins de géolocalisation et de marquage. Cela inclut votre nom, adresse, e-mail et n° de téléphone.','Who on our team has access'=>'Qui de notre équipe a accès aux données','Members of our team have access to the information you provide us. For example, both Administrators and Editors can access:'=>'Les membres de notre équipe ont accès aux informations que vous nous fournissez. Par exemple, les administrateurs et les éditeurs peuvent accéder à  :','Form submission information and other details related to it'=>'Informations d’envois de formulaire et autres détails s’y rapportant.','Customer information like your name, email and address information.'=>'Les informations client comme votre nom, e-mail et adresse.','Our team members have access to this information to help fulfill entries and support you.'=>'Les membres de notre équipe ont accès à ces informations pour vous aider à remplir les entrées et vous aider.','What we share with others'=>'Ce que nous partageons avec d’autres','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Dans cette section, vous devez lister avec qui vous partagez des données, et pour quelle fin. Ceci inclut, mais n’est pas limité à, statistiques, marketing, passerelles de paiement, transporteurs, et contenus tiers.','In this subsection you should list which third party payment processors you’re using to take payments on your site since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Dans cette sous-section, vous devez répertorier les passerelles de paiement tiers que vous utilisez pour effectuer des paiements sur votre site, car elles peuvent gérer les données des clients. Nous avons inclus PayPal à titre d’exemple, mais vous devez la supprimer si vous n’utilisez pas PayPal.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Nous acceptons les paiements par PayPal. Lors du traitement des paiements, certains données seront transmises à PayPal, incluant l’information obligatoires à l’exécution du paiement, tel que le montant total ou les informations de facturation.','Available Modules'=>'Modules disponibles','In this subsection you should list which third party modules you’re using to increase functionality on your site since these may handle customer data. We’ve included MailChimp as an example, but you should remove this if you’re not using MailChimp.'=>'Dans cette sous-section, vous devez répertorier les modules tiers que vous utilisez pour améliorer les fonctionnalités de votre site, car ils peuvent gérer les données client. Nous avons inclus MailChimp à titre d’exemple, mais vous devez le supprimer si vous n’utilisez pas MailChimp.','%s &ndash; Preview'=>'%s &ndash; Prévisualiser','When you fill up a form, we’ll ask you to provide information including your name, address, email, phone number, credit card/payment details and optional account information like username and password and any other form fields available in the form builder. We’ll use this information for purposes, such as, to:'=>'Lorsque vous remplissez un formulaire, nous vous demandons de fournir des informations, notamment votre nom, votre adresse, votre e-mail, votre numéro de téléphone, vos informations de carte de crédit/paiement et des informations de compte facultatives telles que le nom d’utilisateur et le mot de passe et tout autre champ de formulaire disponible dans le générateur de formulaires. Nous utiliserons ces informations à des fins telles que :','Please see the <a href="https://mailchimp.com/legal/privacy/">MailChimp Privacy Policy</a> for more details.'=>'Veuillez consulter la <a href="https://mailchimp.com/legal/privacy/">politique de confidentialité MailChimp</a> pour plus de détails.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Veuillez lire la <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">politique de confidentialité de PayPal</a> pour plus de détails.','We send beautiful email through MailChimp. When processing emails, some of your data will be passed to MailChimp, including information required to process or support the email marketing services, such as the name, email address and any other information that you intend to pass or collect including all collected information through subscription.'=>'Nous envoyons de beaux e-mails via MailChimp. Lors du traitement des e-mails, certaines de vos données seront transmises à MailChimp, y compris les informations nécessaires au traitement ou à la prise en charge des services de marketing par e-mail, telles que le nom, l’adresse e-mail et toute autre information que vous souhaitez transmettre ou collecter, y compris toutes les informations collectées par abonnement.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Nous partageons des données avec des tiers qui nous aident à gérer nos commandes et services de la boutique ; par exemple --','Preview'=>'Aperçu','This sample policy includes the basics around what personal data you may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your form will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Cet exemple de politique de confidentialité inclut les bases concernant les données personnelles que vous pouvez collecter, stocker et partager, ainsi que les personnes pouvant accéder à ces données. Selon les réglages activés et les extensions utilisées, les informations spécifiques partagées par votre formulaire varient. Nous vous recommandons de consulter un avocat avant de décider quelles informations divulguer dans votre politique de confidentialité.','What we collect and store'=>'Ce que nous collectons et stockons','We collect information about you during the form submission process on our site.'=>'Nous collectons des informations vous concernant pendant le processus d’envoi de formulaire sur notre site.','Select all'=>'Tout sélectionner','Select none'=>'Ne rien sélectionner','enhanced selectNo matches found'=>'Aucun résultat','enhanced selectLoading failed'=>'Échec du chargement','enhanced selectPlease enter 1 or more characters'=>'Veuillez saisir 1 caractère ou plus','enhanced selectPlease enter %qty% or more characters'=>'Veuillez saisir %qty% caractères ou plus','enhanced selectPlease delete 1 character'=>'Veuillez supprimer 1 caractère','enhanced selectPlease delete %qty% characters'=>'Veuillez supprimer %qty% caractères','enhanced selectYou can only select 1 item'=>'Vous ne pouvez sélectionner qu’1 article','enhanced selectYou can only select %qty% items'=>'Vous ne pouvez sélectionner que %qty% éléments','enhanced selectLoading more results&hellip;'=>'Charger plus de résultats…','enhanced selectSearching&hellip;'=>'Recherche…','Export CSV'=>'Exporter en CSV','Integration'=>'Intégration','Integrations'=>'Intégrations','Meta Key missing'=>'Clé meta manquante','Missing data'=>'Données manquantes','Connection missing'=>'Connexion manquante','User IP Address'=>'Adresse IP de l’utilisateur','ID'=>'ID','User Device'=>'Appareil utilisateur','%1$s %2$s'=>'%1$s %2$s','Image Upload'=>'Téléverser image','Option 3'=>'Option 3','Make your forms even more robust with our premium addons. Missing any addons? Click the %1$sRefresh Add-ons%2$s button above.'=>'Rendez vos formulaires encore plus robustes avec nos extensions premium. Besoin de modules ? Cliquez sur le bouton %1$sActualiser les modules%2$s ci-dessous.','Please add Meta key for fields: %s'=>'Veuillez ajouter une 